void delay_s(u32 sec)
{
   u32 i=0;
   for(i=0;i<sec;i++)
   {
      delay_ms(500);
      delay_ms(500);
   }
}
__inline void send_byte(u8 byte2send)
{

	 USART3->DR = byte2send;
	while((USART3->SR & USART_FLAG_TC) == (uint16_t)RESET);
	delay_us(4);//decrease to quicken
}
__inline void send_package(u8 *buf,u16 lenth)
{
	u16 i=0;
	u8 sum=0;
	send_byte(0xAA);
	send_byte(0x0B);
	send_byte((lenth+7)&0XFF);
	send_byte((lenth+7)/0X100);
	send_byte(0X11);
	for(i=0;i<lenth;i++)
	{
		send_byte(buf[i]);
	}
	sum=0x0b;
	sum^=((lenth+7)&0XFF);
	sum^=((lenth+7)/0X100);
	sum^=0X11;
	for(i=0;i<lenth;i++)
	{
		sum^=buf[i];
	}
	send_byte(sum);
	send_byte(0x55);
	delay_ms(8);//decrease to quicken

}
__inline void send_lenth(u32 lenth)
{
	u8 lenth_array[10];
	*((u32 *)(lenth_array+6))=lenth;
	lenth_array[0]=0xf4;
	lenth_array[1]=0xf3;
	lenth_array[2]=0xf2;
	lenth_array[3]=0x04;
	lenth_array[4]=0x03;
	lenth_array[5]=0x02;
	send_package(lenth_array,10);
}
void send_image(u8 *image,u16 lenth)  //401  1
{
	u16 i=0;
	u16 cnt;
	cnt=lenth/400;
	send_lenth(lenth);
	for(i=0;i<cnt;i++)
	{
		send_package(image+i*400,400);
	}
	if(lenth%400)
	{
		send_package(image+cnt*400,lenth%400);
	}

}

