void Mputs(u8 *array,u32 lenth)
{
   u32 i=0;
   for(i=0;i<lenth;i++)     
	{
      USART_SendData(USART3, array[i]);
      while((USART3->SR & USART_FLAG_TC) == (uint16_t)RESET);
      delay_us(1);
   }
}

static void MSend(unsigned char *array)
{
   u32 i=0;
   u32 lenth=0;
   u8 sum=0;
   sum=array[1];
   lenth=(array[3]<<8)+array[2];
   for(i=2;i<lenth-2;i++)
   {
      sum^=array[i];
   }
   array[lenth-2]=sum;

   Mputs(array,lenth);     
   
}




